{
  "name": "astralapp/astral",
  "description": "Organize yur GitHub Stars with Ease",
  "keywords": [
    "github",
    "stars",
    "organize",
    "tags"
  ],
  "license": "BSD-3-Clause",
  "type": "project",
  "require": {
    "php": "^8.2",
    "doctrine/dbal": "^3.0",
    "guzzlehttp/guzzle": "^7.0.1",
    "laravel/framework": "^10.0",
